import React from 'react'

const Header = () => {
  return (
    <header className='sticky top-0 w-full py-6 shadow-lg'>
      <div class="container">
        {/* Logo */}
        <a href="" className='text-3xl font-bold'>Logo</a>
      </div>
    </header>
  )
}

export default Header
